All Bill wanted was to work hard and come home to his beautiful wife, Julie.

But when Julie starts to neglect him, he finds himself distracted by the sexy new girl in the office, who happens to be his boss' daughter Hanna (Kayden Kross). When his boss (Evan Stone) demands that he keep an eye on Hanna, her gorgeous smile and tight little body prove too hard to resist. Little does Bill know, his boss thinks the same things about Julie...
